import React from "react";
import Wallpaper from "../commonwallpaper/Wallpaper";
import Footer from "../sign-In/Footer";
import netflixlogo from "../../assets/netflix-logos-idcIWizlPG.png";
import Dropdown from "../commonwallpaper/Dropdown";
import "./SignUp.scss";

function SignUp() {
  return (
    <div
      className="flex bg-black bg-opacity-100 overflow-hidden"
      style={{ backgroundColor: "#000" }}
    >
      <div
       class= "absolute"
        style={{ backgroundColor: "white" }}
      >
        <Dropdown />
      </div>

      <div >
        <span class="font-semibold text-xl tracking-tight">
          <img
            class="h-auto"
            className="img-logo1"
            src={netflixlogo}
            alt="netflix-logo"
            style={{ color: "red" }}
          />
        </span>
      </div>

      {/* <div className="logo-container1">
        <img
          class="h-auto"
          className="img-logo1"
          src={netflixlogo}
          alt="netflix-logo"
          style={{ color: "red" }}
        />
          </div>
         */}

      <div>
        <Wallpaper />
      </div>
      <div>
        <Footer />
      </div>
    </div>
  );
}

export default SignUp;
